import React from 'react';
import {Card, Timeline} from "antd";

const TimelineCard = (props) => {
  console.log(props.purchase);
  return (
      <Timeline.Item>
        <Card size="small" style={{ width: '40%' }}>
          <div layout="inline">
            <p>Card content</p>
            <p>Card content</p>
          </div>
          <p>Card content</p>
          <p>Card content</p>
          <p>Card content</p>
        </Card>
      </Timeline.Item>
  );
};

export default TimelineCard;
